import React from "react";
import ChannelSummary from "./ChannelSummary";

const ChannelList = ({ channels }) => {
  return (
    <div className="channel-list">
      {channels &&
        channel.map((channel) => {
          return <ChannelSummary channel={channel} key={channel.id} />;
        })}
    </div>
  );
};

export default ChannelList;
